import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import './App.css';

// Import components for each section
import CreateStudent from './components/CreateStudent';
import StudentList from './components/StudentList';

import CreateReservation from './components/CreateReservation';
import ReservationList from './components/ReservationList';

import CreateBooking from './components/CreateBooking';
import BookingList from './components/BookingList';

import CreatePaymentMethod from './components/CreatePaymentMethod';
import PaymentMethodList from './components/PaymentMethodList';

import CreateEquipment from './components/CreateEquipment';
import EquipmentList from './components/EquipmentList';

// Header Component (Reusable)
function Header() {
  const location = useLocation();

  return (
    <header className="header">
      <h1>LIC Management System</h1>
      <nav className="nav-buttons">
        <Link
          to="/student-management"
          className={location.pathname === '/student-management' ? 'active' : ''}
        >
          Student Management
        </Link>
        <Link
          to="/reservation-management"
          className={location.pathname === '/reservation-management' ? 'active' : ''}
        >
          Reservation Management
        </Link>
        <Link
          to="/booking-management"
          className={location.pathname === '/booking-management' ? 'active' : ''}
        >
          Booking Management
        </Link>
        <Link
          to="/payment-method-management"
          className={location.pathname === '/payment-method-management' ? 'active' : ''}
        >
          Payment Method Management
        </Link>
        <Link
          to="/equipment-management"
          className={location.pathname === '/equipment-management' ? 'active' : ''}
        >
          Equipment Management
        </Link>
      </nav>
    </header>
  );
}

// Home Page Component
function Home() {
  return (
    <div className="home">
      <h1>Welcome to the LIC Management System</h1>
      <p>Select a section from the navigation menu above.</p>
    </div>
  );
}

// Separate pages for each section
function StudentManagement() {
  return (
    <div>
      <Header />
      <h2>Student Management</h2>
      <CreateStudent />
      <StudentList />
    </div>
  );
}

function ReservationManagement() {
  return (
    <div>
      <Header />
      <h2>Reservation Management</h2>
      <CreateReservation />
      <ReservationList />
    </div>
  );
}

function BookingManagement() {
  return (
    <div>
      <Header />
      <h2>Booking Management</h2>
      <CreateBooking />
      <BookingList />
    </div>
  );
}

function PaymentMethodManagement() {
  return (
    <div>
      <Header />
      <h2>Payment Method Management</h2>
      <CreatePaymentMethod />
      <PaymentMethodList />
    </div>
  );
}

function EquipmentManagement() {
  return (
    <div>
      <Header />
      <h2>Equipment Management</h2>
      <CreateEquipment />
      <EquipmentList />
    </div>
  );
}

// Main App Component
function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/student-management" element={<StudentManagement />} />
          <Route path="/reservation-management" element={<ReservationManagement />} />
          <Route path="/booking-management" element={<BookingManagement />} />
          <Route path="/payment-method-management" element={<PaymentMethodManagement />} />
          <Route path="/equipment-management" element={<EquipmentManagement />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
